import React from 'react';
import './TestComponent.css';
import { Container, Button, InputGroup, FormControl } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function TestComponent() {
  return (
    <Container>
      <h3>Small</h3>
      <InputGroup size="sm">
        <FormControl defaultValue="Font size is reduced" />
        <InputGroup.Append>
          <Button variant="primary">Copy</Button>
        </InputGroup.Append>
      </InputGroup>

      <h3>Default</h3>
      <InputGroup>
        <FormControl defaultValue="Font size is default" />
        <InputGroup.Append>
          <Button variant="primary">Copy</Button>
        </InputGroup.Append>
      </InputGroup>

      <h3>Large</h3>
      <InputGroup size="lg">
        <FormControl defaultValue="Font size is increased" />
        <InputGroup.Append>
          <Button variant="primary">Copy</Button>
        </InputGroup.Append>
      </InputGroup>

    </Container>
  );
}

export default TestComponent;
